import React from "react";
import { Button, Modal } from "react-bootstrap";

export default function DeleteModal(props) {

  const deleteNClose = () => {
    props.deleteClient(props.selectedClient.clientId);
    props.onHide();
    props.setUpdateList(!props.updateList);
  }

  return (
    <Modal
        show={props.showModal}
        size="lg"
        aria-labelledby="contained-modal-title-vcenter"
        centered
        className="CheckInModal"
      >
        <Modal.Header>
          <Modal.Title id="contained-modal-title-vcenter">
          </Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <p>
            Would you like to DELETE ? Phone Number{" "}
            {props.selectedClient.clientPhoneNumber}, and owner name {props.selectedClient.clientName} This action CAN NOT be undone.
          </p>
        </Modal.Body>
        <Modal.Footer>
          <Button className="yesButton" onClick={deleteNClose}>
            Yes
          </Button>
          <Button onClick={props.onHide}>No</Button>
        </Modal.Footer>
      </Modal>
  )
}


